p\" class=\"ft18\">This certificate sets out how the ATOL scheme will protect the people </p>\r\n    <p style=\"position:absolute;top:251px;left:221px;white-space:nowrap\" class=\"ft18\">named on it for the parts of their trip listed below.</p>\r\n</div>\r\n</body>\r\n</html>\r\n\r\n', 985, 3, 'CLDI0002914', '2020-11-02', NULL, NULL, 1, NULL, '2020-11-02 15:49:48', '2020-11-02 15:49:48'),
