(68, 'singlePackage', 0, 512, '<!DOCTYPE html>\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"\" xml:lang=\"\">\r\n<head>\r\n    <title></title>\r\n\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\"/>\r\n    <br/>\r\n    <style type=\"text/css\">\r\n        <!--\r\n        p {margin: 0; padding: 0;}	.ft10{font-size:76px;font-family:Times;color:#231f20;}\r\n        .ft11{font-size:20px;font-family:Times;color:#231f20;}\r\n        .ft12{font-size:19px;font-family:Times;color:#231f20;}\r\n        .ft13{font-size:14px;font-family:Times;color:#231f20;}\r\n        .ft14{font-size:8px;font-family:Times;color:#231f20;}\r\n        .ft15{font-size:16px;font-family:Times;color:#231f20;}\r\n        .ft16{font-size:23px;font-family:Times;color:#231f20;}\r\n        .ft17{font-size:14px;font-family:Times;color:#231f20;}\r\n        .ft18{font-size:13px;font-family:Times;color:#231f20;}\r\n        .ft19{font-size:11px;font-family:Times;color:#231f20;}\r\n        .ft110{font-size:16px;line-height:26px;font-family:Times;color:#231f20;}\r\n        .ft111{font-size:11px;line-height:19px;font-family:Times;color:#231f20;}\r\n        .ft112{font-size:11px;line-height:20px;font-family:Times;color:#231f20;}\r\n        -->\r\n    </style>\r\n</head>\r\n<body bgcolor=\"#A0A0A0\" vlink=\"blue\" link=\"blue\">\r\n<div id=\"page1-div\" style=\"position:relative;width:892px;height:1262px;\">\r\n    <img width=\"892\" height=\"1262\" src=\"https://cloudtravels.co.uk/cert_images/singlePackage.jpg\" alt=\"background image\"/>\r\n\r\n    <p style=\"position:absolute;top:82px;left:163px;white-space:nowrap\" class=\"ft10\"><b>ATOL Certificate</b></p>\r\n    <p style=\"position:absolute;top:173px;left:104px;white-space:nowrap\" class=\"ft11\"><b>This  confirms  that  your  money  is  protected  by  the  ATOL  scheme</b></p>\r\n    <p style=\"position:absolute;top:196px;left:270px;white-space:nowrap\" class=\"ft11\"><b>if  your  travel  company  collapses.  </b></p>\r\n    <p style=\"position:absolute;top:229px;left:127px;white-space:nowrap\" class=\"ft12\">This  certificate  sets  out  how  the  ATOL  scheme  will  protect  the  people  </p>\r\n    <p style=\"position:absolute;top:251px;left:221px;white-space:nowrap\" class=\"ft12\">named  on  it  for  the  parts  of  their  trip  listed  below.</p>\r\n    <p style=\"position:absolute;top:54px;left:129px;white-space:nowrap\" class=\"ft13\">This  is  an  important  document.  Make  sure  that  you  take  it  with  you  when  you  travel.  </p>\r\n    <p style=\"position:absolute;top:1213px;left:454px;white-space:nowrap\" class=\"ft14\">Copyright  UK  Civil  Aviation  Authority.  The  ATOL  Logo  is  a  registered  trade  mark.</p>\r\n    <p style=\"position:absolute;top:312px;left:87px;white-space:nowrap\" class=\"ft15\"><b>Who  is  protected?</b></p>\r\n    <p style=\"position:absolute;top:330px;left:87px;white-space:nowrap\" class=\"ft13\">{{ $who_is_protected }}</p>\r\n\r\n    <p style=\"position:absolute;top:312px;left:564px;white-space:nowrap\" class=\"ft15\"><b>Number  of  passengers:  </b></p>\r\n    <p style=\"position:absolute;top:330px;left:564px;white-space:nowrap\" class=\"ft13\">{{ $number_of_passengers }}</p>\r\n\r\n\r\n    <p style=\"position:absolute;top:429px;left:87px;white-space:nowrap\" class=\"ft15\"><b>What  is  protected?</b></p>\r\n    <p style=\"position:absolute;top:447px;left:87px;white-space:nowrap\" class=\"ft13\"> {{$what_is_protected}} </p>\r\n\r\n    <p style=\"position:absolute;top:574px;left:87px;white-space:nowrap\" class=\"ft13\">You  can  find  more  detailed  information  on  your  booking,  including  price,  on  the  </p>\r\n    <p style=\"position:absolute;top:585px;left:87px;white-space:nowrap\" class=\"ft13\">confirmation  you  will  receive  from Cloud Travel  </p>\r\n    <p style=\"position:absolute;top:600px;left:87px;white-space:nowrap\" class=\"ft15\"><b>Who  is  protecting  your  trip?</b></p>\r\n    <p style=\"position:absolute;top:620px;left:87px;white-space:nowrap\" class=\"ft13\">{{ $who_is_protecting_your_trip }}</p>\r\n\r\n    <p style=\"position:absolute;top:641px;left:355px;white-space:nowrap\" class=\"ft16\"><b>Your  protection</b></p>\r\n    <p style=\"position:absolute;top:674px;left:87px;white-space:nowrap\" class=\"ft110\">You  are  protected  from  when  you  were  given  this  certificate  to  the  end  of  your  trip.  <br/>If</p>\r\n    <p style=\"position:absolute;top:705px;left:102px;white-space:nowrap\" class=\"ft13\">Cloud Travel stops  trading,  the  passengers  named  above  will  either:</p>\r\n    <p style=\"position:absolute;top:749px;left:102px;white-space:nowrap\" class=\"ft13\">1.  take  and  complete  their  trip;  or</p>\r\n    <p style=\"position:absolute;top:767px;left:102px;white-space:nowrap\" class=\"ft13\">2.</p>\r\n    <p style=\"position:absolute;top:766px;left:126px;white-space:nowrap\" class=\"ft13\">receive  a  refund.</p>\r\n    <p style=\"position:absolute;top:795px;left:87px;white-space:nowrap\" class=\"ft13\">Your  protection  depends  on  the  terms  of  the  ATOL  scheme  and  the  specifics  of  the  ATOL  </p>\r\n    <p style=\"position:absolute;top:816px;left:87px;white-space:nowrap\" class=\"ft13\">holder  failure  </p>\r\n    <p style=\"position:absolute;top:814px;left:195px;white-space:nowrap\" class=\"ft13\">(available  at  www.atol.org.uk).</p>\r\n    <p style=\"position:absolute;top:848px;left:87px;white-space:nowrap\" class=\"ft13\"></p>\r\n    <p style=\"position:absolute;top:869px;left:87px;white-space:nowrap\" class=\"ft13\">If   Cloud Travel stops  trading,  you  must  follow  the  instructions  at  www.atol.org.uk  (where  there  will  be  </p>\r\n    <p style=\"position:absolute;top:888px;left:87px;white-space:nowrap\" class=\"ft13\">details  of  repatriation  arrangements,  and  information  on  how  people  can  claim  their  money  </p>\r\n    <p style=\"position:absolute;top:908px;left:87px;white-space:nowrap\" class=\"ft13\">back)  or  you  can  call  (+44)  333 103 6350.</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:102px;white-space:nowrap\" class=\"ft17\">Unique  reference  number</p>\r\n    <p style=\"position:absolute;top:1186px;left:102px;white-space:nowrap\" class=\"ft17\">{{ $unique_reference_number }}</p>\r\n\r\n    <p style=\"position:absolute;top:1147px;left:277px;white-space:nowrap\" class=\"ft17\">Date  of  issue:</p>\r\n    <p style=\"position:absolute;top:1186px;left:277px;white-space:nowrap\" class=\"ft17\">{{ $date_of_issue }}</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:407px;white-space:nowrap\" class=\"ft17\">ATOL  Certificate</p>\r\n    <p style=\"position:absolute;top:1155px;left:441px;white-space:nowrap\" class=\"ft17\">Issuer:</p>\r\n    <p style=\"position:absolute;top:1186px;left:425px;white-space:nowrap\" class=\"ft17\">{{ $certificate_issuer }}</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:584px;white-space:nowrap\" class=\"ft17\">ATOL  </p>\r\n    <p style=\"position:absolute;top:1155px;left:575px;white-space:nowrap\" class=\"ft17\">number:</p>\r\n    <p style=\"position:absolute;top:1186px;left:575px;white-space:nowrap\" class=\"ft17\">{{ $atol_number }}</p>\r\n\r\n\r\n    <p style=\"position:absolute;top:1145px;left:711px;white-space:nowrap\" class=\"ft15\"><b>Package</b></p>\r\n    <p style=\"position:absolute;top:1175px;left:700px;white-space:nowrap\" class=\"ft18\"><b>(Single-contract)</b></p>\r\n    <p style=\"position:absolute;top:1170px;left:802px;white-space:nowrap\" class=\"ft15\"><b>  </b></p>\r\n\r\n    <p style=\"position:absolute;top:978px;left:87px;white-space:nowrap\" class=\"ft13\"> By Issuing this ATOL Certificate, under Regulation 17 of the Civil Aviation (Air Travel Organisers\' Licensing)\r\n        <br>Regulations 2012(as amended). Cloud Travel confirms that the trip to which it applies is solid in line with the\r\n        <br>ATOL held by the organiser named above. The ATOL scheme is run by the Civil Aviation Authority and paid\r\n        <br>for by the Air Travel Trust. To see what that is and what you can expect, together with full information on its\r\n        <br>terms and conditions go to www.atol.org.uk. As well as the protection of ATOL Scheme, you have protection\r\n        <br>under the Package Travel and Linked Travel. Arrangements Regulations. </p>\r\n\r\n    <p style=\"position:absolute;top:1086px;left:87px;white-space:nowrap\" class=\"ft13\">For more information see www.direct.gov.uk in the Travel and Transport Section</p>\r\n</div>\r\n</body>\r\n</html>\r\n\r\n\r\n', 0, 1, 'CLDI0002982', '2021-05-04', NULL, NULL, 1, NULL, '2021-05-04 13:59:14', '2021-05-04 13:59:14'),
(69, 'flightOnly', 2, 513, '<!DOCTYPE html>\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"\" xml:lang=\"\">\r\n<head>\r\n    <title></title>\r\n\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\"/>\r\n    <br/>\r\n    <style type=\"text/css\">\r\n        <!--\r\n        p {margin: 0; padding: 0;}	.ft10{font-size:76px;font-family:Times;color:#231f20;}\r\n        .ft11{font-size:14px;font-family:Times;color:#231f20;}\r\n        .ft12{font-size:8px;font-family:Times;color:#231f20;}\r\n        .ft13{font-size:14px;font-family:Times;color:#231f20;}\r\n        .ft14{font-size:23px;font-family:Times;color:#231f20;}\r\n        .ft15{font-size:11px;font-family:Times;color:#231f20;}\r\n        .ft16{font-size:14px;font-family:Times;color:#231f20;}\r\n        .ft17{font-size:20px;font-family:Times;color:#231f20;}\r\n        .ft18{font-size:19px;font-family:Times;color:#231f20;}\r\n        .ft19{font-size:11px;line-height:19px;font-family:Times;color:#231f20;}\r\n        -->\r\n    </style>\r\n</head>\r\n<body bgcolor=\"#A0A0A0\" vlink=\"blue\" link=\"blue\">\r\n<div id=\"page1-div\" style=\"position:relative;width:892px;height:1262px;\">\r\n    <img width=\"892\" height=\"1262\" src=\"https://cloudtravels.co.uk/cert_images/flightOnly.jpg\" alt=\"background image\"/>\r\n    <p style=\"position:absolute;top:82px;left:163px;white-space:nowrap\" class=\"ft10\"><b>ATOL Certificate</b></p>\r\n    <p style=\"position:absolute;top:54px;left:129px;white-space:nowrap\" class=\"ft11\">This is an important document. Make sure that you take it with you when you travel. </p>\r\n    <p style=\"position:absolute;top:1213px;left:454px;white-space:nowrap\" class=\"ft12\">Copyright UK Civil Aviation Authority. The ATOL Logo is a registered trade mark.</p>\r\n    <p style=\"position:absolute;top:312px;left:87px;white-space:nowrap\" class=\"ft13\"><b>Who is protected?</b></p>\r\n    <p style=\"position:absolute;top:312px;left:87px;white-space:nowrap\" class=\"ft13\"><b>Who is protected?</b></p>\r\n    <p style=\"position:absolute;top:330px;left:87px;white-space:nowrap\" class=\"ft13\">{{ $who_is_protected }}</p>\r\n\r\n    <p style=\"position:absolute;top:312px;left:564px;white-space:nowrap\" class=\"ft13\"><b>Number of passengers: </b></p>\r\n    <p style=\"position:absolute;top:330px;left:564px;white-space:nowrap\" class=\"ft13\">{{ $number_of_passengers }}</p>\r\n\r\n    <p style=\"position:absolute;top:390px;left:87px;white-space:nowrap\" class=\"ft13\"><b>What is protected?</b></p>\r\n    <p style=\"position:absolute;top:407px;left:87px;white-space:nowrap\" class=\"ft13\"> $what_is_protected </p>\r\n\r\n    <p style=\"position:absolute;top:490px;left:87px;white-space:nowrap\" class=\"ft13\"><b>Who is protecting your flight?</b></p>\r\n    <p style=\"position:absolute;top:505px;left:87px;white-space:nowrap\" class=\"ft13\">{{ $who_is_protecting_your_flight }}</p>\r\n\r\n    <p style=\"position:absolute;top:535px;left:87px;white-space:nowrap\" class=\"ft13\"><b>ATOL protected cost</b></p>\r\n    <p style=\"position:absolute;top:552px;left:87px;white-space:nowrap\" class=\"ft13\"> £{{ $atol_protected_cost }}</p>\r\n\r\n    <p style=\"position:absolute;top:599px;left:357px;white-space:nowrap\" class=\"ft14\"><b>Your protection</b></p>\r\n    <p style=\"position:absolute;top:637px;left:87px;white-space:nowrap\" class=\"ft11\">You are protected from when you were given this certificate until you return to the UK.</p>\r\n    <p style=\"position:absolute;top:657px;left:88px;white-space:nowrap\" class=\"ft11\">If Cloud Travel stops trading, the passengers named above will either:</p>\r\n    <p style=\"position:absolute;top:701px;left:102px;white-space:nowrap\" class=\"ft11\">1.</p>\r\n    <p style=\"position:absolute;top:699px;left:126px;white-space:nowrap\" class=\"ft11\">be returned to the UK; or</p>\r\n    <p style=\"position:absolute;top:722px;left:102px;white-space:nowrap\" class=\"ft11\">2.</p>\r\n    <p style=\"position:absolute;top:720px;left:126px;white-space:nowrap\" class=\"ft11\">receive a refund for the amount above (or your deposit if that is all you have paid so far).</p>\r\n    <p style=\"position:absolute;top:760px;left:87px;white-space:nowrap\" class=\"ft11\">Your protection depends on the terms of the ATOL scheme (available at www.atol.org.uk).</p>\r\n    <p style=\"position:absolute;top:802px;left:87px;white-space:nowrap\" class=\"ft11\">If Cloud Travel stops trading, you must follow the instructions at</p>\r\n    <p style=\"position:absolute;top:822px;left:87px;white-space:nowrap\" class=\"ft11\">www.atol.org.uk (where there will be details of arrangements to bring people back to the </p>\r\n    <p style=\"position:absolute;top:842px;left:87px;white-space:nowrap\" class=\"ft11\">UK, and information on how people can claim money back). </p>\r\n    <p style=\"position:absolute;top:861px;left:87px;white-space:nowrap\" class=\"ft11\">Or, you can call (+44) 333 103 6350.</p>\r\n    <p style=\"position:absolute;top:898px;left:395px;white-space:nowrap\" class=\"ft14\"><b>Warning</b></p>\r\n    <p style=\"position:absolute;top:925px;left:87px;white-space:nowrap\" class=\"ft11\">This certificate only protects the above flight/s you have booked. Any other travel services </p>\r\n    <p style=\"position:absolute;top:947px;left:87px;white-space:nowrap\" class=\"ft11\">you booked are not protected by this certificate.</p>\r\n\r\n <p style=\"position:absolute;top:1008px;left:87px;white-space:nowrap\" class=\"ft192\"> By Issuing this ATOL Certificate, under Regulation 17 of the Civil Aviation (Air Travel Organisers\' Licensing) \r\n<br> Regulations 2012(as amended). Cloud Travel confirms that the trip to which it applies is solid in line with the\r\n<br> ATOL held by Cloud Travel</p>\r\n\r\n    <p style=\"position:absolute;top:1074px;left:87px;white-space:nowrap\" class=\"ft192\">The ATOL scheme is run by the Civil Aviation Authority and paid for by the Air Travel Trust. To see what that <br> is and what you can expect, together with full information on its terms and conditions, go to www.atol.org.uk.</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:102px;white-space:nowrap\" class=\"ft16\">Unique reference number</p>\r\n    <p style=\"position:absolute;top:1186px;left:117px;white-space:nowrap\" class=\"ft16\">{{ $unique_reference_number }}</p>\r\n\r\n    <p style=\"position:absolute;top:1147px;left:277px;white-space:nowrap\" class=\"ft16\">Date of issue:</p>\r\n    <p style=\"position:absolute;top:1186px;left:291px;white-space:nowrap\" class=\"ft16\">{{ $date_of_issue }}</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:407px;white-space:nowrap\" class=\"ft16\">ATOL Certificate</p>\r\n    <p style=\"position:absolute;top:1155px;left:441px;white-space:nowrap\" class=\"ft16\">Issuer:</p>\r\n    <p style=\"position:absolute;top:1186px;left:423px;white-space:nowrap\" class=\"ft16\">{{ $certificate_issuer }}</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:584px;white-space:nowrap\" class=\"ft16\">ATOL </p>\r\n    <p style=\"position:absolute;top:1155px;left:575px;white-space:nowrap\" class=\"ft16\">number:</p>\r\n    <p style=\"position:absolute;top:1186px;left:575px;white-space:nowrap\" class=\"ft16\">{{ $atol_number }}</p>\r\n\r\n    <p style=\"position:absolute;top:1150px;left:705px;white-space:nowrap\" class=\"ft13\"><b>Flight-only </b></p>\r\n    <p style=\"position:absolute;top:1181px;left:302px;white-space:nowrap\" class=\"ft11\"> </p>\r\n    <p style=\"position:absolute;top:1181px;left:337px;white-space:nowrap\" class=\"ft11\">  </p>\r\n    <p style=\"position:absolute;top:173px;left:104px;white-space:nowrap\" class=\"ft17\"><b>This confirms that your money is protected by the ATOL scheme</b></p>\r\n    <p style=\"position:absolute;top:196px;left:270px;white-space:nowrap\" class=\"ft17\"><b>if your travel company collapses. </b></p>\r\n    <p style=\"position:absolute;top:229px;left:127px;white-space:nowrap\" class=\"ft18\">This certificate sets out how the ATOL scheme will protect the people </p>\r\n    <p style=\"position:absolute;top:251px;left:221px;white-space:nowrap\" class=\"ft18\">named on it for the parts of their trip listed below.</p>\r\n</div>\r\n</body>\r\n</html>\r\n\r\n', 495, 2, 'CLDI0002983', '2021-05-06', NULL, NULL, 1, NULL, '2021-05-06 11:02:18', '2021-05-06 11:02:18'),
(70, 'flightOnly', 1, 514, '<!DOCTYPE html>\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"\" xml:lang=\"\">\r\n<head>\r\n    <title></title>\r\n\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\"/>\r\n    <br/>\r\n    <style type=\"text/css\">\r\n        <!--\r\n        p {margin: 0; padding: 0;}	.ft10{font-size:76px;font-family:Times;color:#231f20;}\r\n        .ft11{font-size:14px;font-family:Times;color:#231f20;}\r\n        .ft12{font-size:8px;font-family:Times;color:#231f20;}\r\n        .ft13{font-size:14px;font-family:Times;color:#231f20;}\r\n        .ft14{font-size:23px;font-family:Times;color:#231f20;}\r\n        .ft15{font-size:11px;font-family:Times;color:#231f20;}\r\n        .ft16{font-size:14px;font-family:Times;color:#231f20;}\r\n        .ft17{font-size:20px;font-family:Times;color:#231f20;}\r\n        .ft18{font-size:19px;font-family:Times;color:#231f20;}\r\n        .ft19{font-size:11px;line-height:19px;font-family:Times;color:#231f20;}\r\n        -->\r\n    </style>\r\n</head>\r\n<body bgcolor=\"#A0A0A0\" vlink=\"blue\" link=\"blue\">\r\n<div id=\"page1-div\" style=\"position:relative;width:892px;height:1262px;\">\r\n    <img width=\"892\" height=\"1262\" src=\"https://cloudtravels.co.uk/cert_images/flightOnly.jpg\" alt=\"background image\"/>\r\n    <p style=\"position:absolute;top:82px;left:163px;white-space:nowrap\" class=\"ft10\"><b>ATOL Certificate</b></p>\r\n    <p style=\"position:absolute;top:54px;left:129px;white-space:nowrap\" class=\"ft11\">This is an important document. Make sure that you take it with you when you travel. </p>\r\n    <p style=\"position:absolute;top:1213px;left:454px;white-space:nowrap\" class=\"ft12\">Copyright UK Civil Aviation Authority. The ATOL Logo is a registered trade mark.</p>\r\n    <p style=\"position:absolute;top:312px;left:87px;white-space:nowrap\" class=\"ft13\"><b>Who is protected?</b></p>\r\n    <p style=\"position:absolute;top:312px;left:87px;white-space:nowrap\" class=\"ft13\"><b>Who is protected?</b></p>\r\n    <p style=\"position:absolute;top:330px;left:87px;white-space:nowrap\" class=\"ft13\">{{ $who_is_protected }}</p>\r\n\r\n    <p style=\"position:absolute;top:312px;left:564px;white-space:nowrap\" class=\"ft13\"><b>Number of passengers: </b></p>\r\n    <p style=\"position:absolute;top:330px;left:564px;white-space:nowrap\" class=\"ft13\">{{ $number_of_passengers }}</p>\r\n\r\n    <p style=\"position:absolute;top:390px;left:87px;white-space:nowrap\" class=\"ft13\"><b>What is protected?</b></p>\r\n    <p style=\"position:absolute;top:407px;left:87px;white-space:nowrap\" class=\"ft13\"> $what_is_protected </p>\r\n\r\n    <p style=\"position:absolute;top:490px;left:87px;white-space:nowrap\" class=\"ft13\"><b>Who is protecting your flight?</b></p>\r\n    <p style=\"position:absolute;top:505px;left:87px;white-space:nowrap\" class=\"ft13\">{{ $who_is_protecting_your_flight }}</p>\r\n\r\n    <p style=\"position:absolute;top:535px;left:87px;white-space:nowrap\" class=\"ft13\"><b>ATOL protected cost</b></p>\r\n    <p style=\"position:absolute;top:552px;left:87px;white-space:nowrap\" class=\"ft13\"> £{{ $atol_protected_cost }}</p>\r\n\r\n    <p style=\"position:absolute;top:599px;left:357px;white-space:nowrap\" class=\"ft14\"><b>Your protection</b></p>\r\n    <p style=\"position:absolute;top:637px;left:87px;white-space:nowrap\" class=\"ft11\">You are protected from when you were given this certificate until you return to the UK.</p>\r\n    <p style=\"position:absolute;top:657px;left:88px;white-space:nowrap\" class=\"ft11\">If Cloud Travel stops trading, the passengers named above will either:</p>\r\n    <p style=\"position:absolute;top:701px;left:102px;white-space:nowrap\" class=\"ft11\">1.</p>\r\n    <p style=\"position:absolute;top:699px;left:126px;white-space:nowrap\" class=\"ft11\">be returned to the UK; or</p>\r\n    <p style=\"position:absolute;top:722px;left:102px;white-space:nowrap\" class=\"ft11\">2.</p>\r\n    <p style=\"position:absolute;top:720px;left:126px;white-space:nowrap\" class=\"ft11\">receive a refund for the amount above (or your deposit if that is all you have paid so far).</p>\r\n    <p style=\"position:absolute;top:760px;left:87px;white-space:nowrap\" class=\"ft11\">Your protection depends on the terms of the ATOL scheme (available at www.atol.org.uk).</p>\r\n    <p style=\"position:absolute;top:802px;left:87px;white-space:nowrap\" class=\"ft11\">If Cloud Travel stops trading, you must follow the instructions at</p>\r\n    <p style=\"position:absolute;top:822px;left:87px;white-space:nowrap\" class=\"ft11\">www.atol.org.uk (where there will be details of arrangements to bring people back to the </p>\r\n    <p style=\"position:absolute;top:842px;left:87px;white-space:nowrap\" class=\"ft11\">UK, and information on how people can claim money back). </p>\r\n    <p style=\"position:absolute;top:861px;left:87px;white-space:nowrap\" class=\"ft11\">Or, you can call (+44) 333 103 6350.</p>\r\n    <p style=\"position:absolute;top:898px;left:395px;white-space:nowrap\" class=\"ft14\"><b>Warning</b></p>\r\n    <p style=\"position:absolute;top:925px;left:87px;white-space:nowrap\" class=\"ft11\">This certificate only protects the above flight/s you have booked. Any other travel services </p>\r\n    <p style=\"position:absolute;top:947px;left:87px;white-space:nowrap\" class=\"ft11\">you booked are not protected by this certificate.</p>\r\n\r\n <p style=\"position:absolute;top:1008px;left:87px;white-space:nowrap\" class=\"ft192\"> By Issuing this ATOL Certificate, under Regulation 17 of the Civil Aviation (Air Travel Organisers\' Licensing) \r\n<br> Regulations 2012(as amended). Cloud Travel confirms that the trip to which it applies is solid in line with the\r\n<br> ATOL held by Cloud Travel</p>\r\n\r\n    <p style=\"position:absolute;top:1074px;left:87px;white-space:nowrap\" class=\"ft192\">The ATOL scheme is run by the Civil Aviation Authority and paid for by the Air Travel Trust. To see what that <br> is and what you can expect, together with full information on its terms and conditions, go to www.atol.org.uk.</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:102px;white-space:nowrap\" class=\"ft16\">Unique reference number</p>\r\n    <p style=\"position:absolute;top:1186px;left:117px;white-space:nowrap\" class=\"ft16\">{{ $unique_reference_number }}</p>\r\n\r\n    <p style=\"position:absolute;top:1147px;left:277px;white-space:nowrap\" class=\"ft16\">Date of issue:</p>\r\n    <p style=\"position:absolute;top:1186px;left:291px;white-space:nowrap\" class=\"ft16\">{{ $date_of_issue }}</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:407px;white-space:nowrap\" class=\"ft16\">ATOL Certificate</p>\r\n    <p style=\"position:absolute;top:1155px;left:441px;white-space:nowrap\" class=\"ft16\">Issuer:</p>\r\n    <p style=\"position:absolute;top:1186px;left:423px;white-space:nowrap\" class=\"ft16\">{{ $certificate_issuer }}</p>\r\n\r\n    <p style=\"position:absolute;top:1139px;left:584px;white-space:nowrap\" class=\"ft16\">ATOL </p>\r\n    <p style=\"position:absolute;top:1155px;left:575px;white-space:nowrap\" class=\"ft16\">number:</p>\r\n    <p style=\"position:absolute;top:1186px;left:575px;white-space:nowrap\" class=\"ft16\">{{ $atol_number }}</p>\r\n\r\n    <p style=\"position:absolute;top:1150px;left:705px;white-space:nowrap\" class=\"ft13\"><b>Flight-only </b></p>\r\n    <p style=\"position:absolute;top:1181px;left:302px;white-space:nowrap\" class=\"ft11\"> </p>\r\n    <p style=\"position:absolute;top:1181px;left:337px;white-space:nowrap\" class=\"ft11\">  </p>\r\n    <p style=\"position:absolute;top:173px;left:104px;white-space:nowrap\" class=\"ft17\"><b>This confirms that your money is protected by the ATOL scheme</b></p>\r\n    <p style=\"position:absolute;top:196px;left:270px;white-space:nowrap\" class=\"ft17\"><b>if your travel company collapses. </b></p>\r\n    <p style=\"position:absolute;top:229px;left:127px;white-space:nowrap\" class=\"ft18\">This certificate sets out how the ATOL scheme will protect the people </p>\r\n    <p style=\"position:absolute;top:251px;left:221px;white-space:nowrap\" class=\"ft18\">named on it for the parts of their trip listed below.</p>\r\n</div>\r\n</body>\r\n</html>\r\n\r\n', 159, 2, 'CLDI0002984', '2021-05-06', NULL, NULL, 1, NULL, '2021-05-06 17:24:12', '2021-05-06 17:24:12');
