s who hold an OCI who travel to INDIA without their original  OCI card will be denied boarding. <br>\n  Passengers travelling to/ or via USA/CANADA: will require an ESTA at  least 72 hours prior to travel, even for transit purposes. Children under 18  travelling to South Africa and Botswana: All minors travelling will be required  to carry certified copies Birth Certificate, and in the event that only one  parent is travelling, certified written consent from the other parent to allow  the child to travel. <br>\n  If there are any long (or overnight transits) , include multiple transit  points enroute within a country, it is the passengers responsibility to make  the necessary accommodation and visa arrangements.<br>\n  <font color=\"red\"><strong>Passenger Notice:</strong></font><br>\n  Carriage and other services provided by the carrier are subject to  conditions of contract, which are hereby incorporated by reference. These  conditions may be obtained from the issuing carrier. The itinerary/receipt  constitutes the passenger ticket for the purposes of Article 3 of the Warsaw  convention, except where the carrier delivers to the passenger another document  complying with the requirements of Article 3. If the passenger\'s journey  involves an ultimate destination or stop in a country other than the country of  departure the Warsaw Convention may be applicable, and the convention governs,  and in most cases limits, the liability of carriers for death or personal  injury and in respect of loss of or damage to baggage. See also notices headed  Advice to International Passengers on limitation of liability and notice of  baggage liability limitations. Full conditions can be found at<br>\n  www.iata.org or by clicking here<br>\n  If you are travelling to USA, all qualified Visa Waiver Program  travellers will be required to obtain electronic travel authorization prior to  boarding an air or sea carrier to the United States.<br>\n  Electronic System for Travel Authorization (ESTA) to USA<br>\n  Travellers who do not receive travel authorization prior to their  departure may be denied boarding, experience delays or be denied admission into  the United States. Applications may be submitted at any time prior to travel,  but no less than 72 hours prior to departure.<br>\n  Travel Authorization is obtained through an online registration system  known as the Electronic System for <strong>Travel  Authorization (ESTA).</strong> <br>\n  If your registration is successful, it will be valid for multiple  applications for two years or until the date on which your passport expires, whichever  comes first.<br>\n  Submit your ESTA Application at <br>\n  www.iata.org<br>\n </p><p align=\"justify\"><strong> Note/Disclaimer:\nIt is the sole responsibility of the passenger to ensure his / her eligibility to enter the destination country. Cloud Travel accepts no liability in this regard.  <br>\n		 In case of Visa ,flight suspensions,cancellation or not operating in that case we will apply for a full refund form airline and we will only be Deduct our service charge and all other the Atol/IATA protections, cash handling fee, administration charges will be applied </strong>		 </p>\n		<br>\n <p align=\"right\"> Yours Sincerely</p>\n				<p></p>\n				  <p></p>\n\n				</li>\n            </ul>\n         <p align=\"center\">   <a href=\"javascript:void(0);\" class=\"btn btn-success noprint\" onclick=\"window.print()\">Print Invoice</a> </p>', '2020-09-17 06:17:08', '2020-09-17 06:17:08'),
