on (ESTA) to USA<br>\n  Travellers who do not receive travel authorization prior to their  departure may be denied boarding, experience delays or be denied admission into  the United States. Applications may be submitted at any time prior to travel,  but no less than 72 hours prior to departure.<br>\n  Travel Authorization is obtained through an online registration system  known as the Electronic System for <strong>Travel  Authorization (ESTA).</strong> <br>\n  If your registration is successful, it will be valid for multiple  applications for two years or until the date on which your passport expires, whichever  comes first.<br>\n  Submit your ESTA Application at <br>\n  www.iata.org<br>\n </p><p align=\"justify\"><strong> Note/Disclaimer:\nIt is the sole responsibility of the passenger to ensure his / her eligibility to enter the destination country. Cloud Travel accepts no liability in this regard.  <br>\n		 In case of Visa ,flight suspensions,cancellation or not operating in that case we will apply for a full refund form airline and we will only be Deduct our service charge and all other the Atol/IATA protections, cash handling fee, administration charges will be applied </strong>		 </p>\n		<br>\n <p align=\"right\"> Yours Sincerely</p>\n				<p></p>\n				  <p></p>\n\n				</li>\n            </ul>\n         <p align=\"center\">   <a href=\"javascript:void(0);\" class=\"btn btn-success noprint\" onclick=\"window.print()\">Print Invoice</a> </p>', '2020-12-14 18:45:07', '2020-12-14 18:45:07'),
